@boiby @lhunter1310 @utpress @boibyJH @UofTDoMChair @MedicalPost I’m sorry @boiby but I’m not following what you’re trying to say. 

Yes, chronic illness can co-exist with or without trauma. But that is not the theory actually applied to many complex, chronic illnesses. 

You also said we’re all insecure? Not following that part.

@lhunter1310 @utpress @boiby @boibyJH @UofTDoMChair @MedicalPost Not what I said. 

For many with complex, chronic illnesses, the trauma theory has caused us great harm. It has kept us from accessing care and disability supports. It has stigmatized our entire experience so that we were not believed when we presented with symptoms. 

1/2

@Rsbeidas @onepeloton @RobinNYC I’ve always been a very active person who loves the outdoors &amp; challenging myself. So I can totally relate. :)

Unfortunately, I now have post viral #MyalgicEncephalomyelitis so even minimal exertion crashes me for days.

Hoping for treatments soon, so I can get back out there.🤞

@AlyssaaErinn @BreathewellPT I’m sorry that you’re having to go through this assessment, especially the way it’s set up.

Trust yourself and push back or rest when you need to.

And we always encourage individuals to follow up a few days later and report their PEM symptoms, if present.

@TjTupechka Side note: You and I have similar backgrounds @TjTupechka!💛

I don’t meet many community educators in the ME community. It’s a great background to have for advocacy and research too…when we are able to use our skills, of course.

Hope we can collaborate some day. 🤞

@TjTupechka You’re so right on being flexible and understanding the variability of each day. 

So many new patients reaching out are being set up to feel like they’re failing when they can’t stick to a plan that a healthy HCP suggested.

Pacing just isn’t that simple.

